    return (
        <div className = "new-post">
            <h1>New Post</h1>
            <form>
                <label htmlFor="name">Name</label>
                <input type="text" id="name" name="name"/>
                <label htmlFor="address">Address</label>
                
            </form>
        </div>
    );
    };
